import { Button } from '@mui/base/Button';

function Seat({seatNum, data})
{
    let style = "seat rounded-md";
    style += data.available ? " border-solid border-teal-300 bg-transparent" :  " bg-teal-300";

    return (
        <Button className={style}>{data.seatNum + 5}</Button>
    )
}

export default Seat;
